import React, { useState, useEffect } from 'react';
import { PieChart, PieArcSeries } from 'reaviz';

function NavBar() {
  return (
    <nav>
      <a href="../project-jsorror/index.html"><img src="./img/iconblue.png" alt="four circles around person" className="icon" /></a>
      <ul>
        <li><a href="../project-jsorror/index.html">Home</a></li>
        <li><a href="../project-jsorror/profile.html">Profile</a></li>
        <li><a href="../project-jsorror/teams.html">Teams</a></li>
      </ul>
    </nav>
  );
}

function Header() {
  return (
    <header>
      <h1><em>tea</em><b>MBTI</b></h1>
    </header>
  );
}

// Function to fetch member data
function fetchMemberData(memberId) {
  console.log('Fetching data for memberId:', memberId);
  const mockData = {
    'member1': {
      dataEI: [{ key: 'I', data: 75 }, { key: 'E', data: 25 }],
      dataSN: [{ key: 'S', data: 60 }, { key: 'N', data: 40 }],
      dataTF: [{ key: 'T', data: 70 }, { key: 'F', data: 30 }],
      dataJP: [{ key: 'J', data: 65 }, { key: 'P', data: 35 }]
    },
    'member2': {
      dataEI: [{ key: 'I', data: 50 }, { key: 'E', data: 50 }],
      dataSN: [{ key: 'S', data: 40 }, { key: 'N', data: 60 }],
      dataTF: [{ key: 'T', data: 30 }, { key: 'F', data: 70 }],
      dataJP: [{ key: 'J', data: 35 }, { key: 'P', data: 65 }]
    }
  };
  return Promise.resolve(mockData[memberId] || null);
}

const MemberChart = ({ data, colorScheme }) => (
  <div className="chart-wrapper">
    <PieChart
      width={250}
      height={250}
      data={data}
      series={<PieArcSeries colorScheme={colorScheme} />}
    />
  </div>
);

const CompatabilityCharts = ({ memberId1, memberId2 }) => {
  const [memberData1, setMemberData1] = useState(null);
  const [memberData2, setMemberData2] = useState(null);

  useEffect(() => {
    fetchMemberData(memberId1).then(data => setMemberData1(data));
    fetchMemberData(memberId2).then(data => setMemberData2(data));
  }, [memberId1, memberId2]);

  if (!memberData1 || !memberData2) return <div>Loading...</div>;

  return (
    <div className="chart-container">
      <div className="member-chart">
        <h2>Member 1</h2>
        <MemberChart data={memberData1.dataEI} colorScheme={['#E5E8B6', '#F6DC8D']} />
        <MemberChart data={memberData1.dataSN} colorScheme={['#BEB8EB', '#022B3A']} />
        <MemberChart data={memberData1.dataTF} colorScheme={['#E3EEE2', '#ACD1E9']} />
        <MemberChart data={memberData1.dataJP} colorScheme={['#F49A9A91', '#E0E0E2']} />
      </div>
      <div className="member-chart">
        <h2>Member 2</h2>
        <MemberChart data={memberData2.dataEI} colorScheme={['#E5E8B6', '#F6DC8D']} />
        <MemberChart data={memberData2.dataSN} colorScheme={['#BEB8EB', '#022B3A']} />
        <MemberChart data={memberData2.dataTF} colorScheme={['#E3EEE2', '#ACD1E9']} />
        <MemberChart data={memberData2.dataJP} colorScheme={['#F49A9A91', '#E0E0E2']} />
      </div>
    </div>
  );
};

function Compatability({ memberId1, memberId2 }) {
  return (
    <div className="mainmbti">
      <Header />
      <CompatabilityCharts memberId1={memberId1} memberId2={memberId2} />
    </div>
  );
}

function Footer() {
  return <footer>&copy; 2024 teaMBTI</footer>;
}

export { NavBar, Header, Compatability, Footer };
